import React from 'react';

// This is the table constant/settings which needed to render table elements
// export const tableConstants = (handleEdit) => {
export const tableConstants = (handleEdit) => {
  return [
    {
      title: 'SL. No',
      render: rowData => {
        return <span>{rowData.id}</span>;
      },
    },
    {
      title: 'ICCID / SN',
      render: rowData => {
        return <span>{rowData.iccid}</span>;
      },
    },
    {
      title: 'MDN',
      render: rowData => {
        return <span>{rowData.mdnNo}</span>;
      },
    },
    {
      title: 'FG Code',
      render: rowData => {
        return <span>{rowData.fgCode}</span>;
      },
    },
    {
      title: 'DO NUMBER',
      render: rowData => {
        return <span>{rowData.doNumber}</span>;
      },
    },

    {
      title: 'Action',
      render: rowData => {
        return <button className='btn btn-warning' onClick={handleEdit(rowData)}>Edit</button>
      },
    },
  ];
};
